{'id': 'ua6Mb2', 'name': "Banks's Mild", 'nameDisplay': "Banks's Mild", 'description': "The original Banks's brew. This is the beer that made Banks's famous and is still the world's best selling mild - it's beautifully balanced, smooth and very moreish.

A light chestnut coloured beer, exhibiting a glorious balance. Malty with a perceptible burnt note, it's full bodied with a hint of bitterness counterbalancing the rich, biscuity flavour from the best barley.

The perfect accompaniment to a spicy Indian dish or strong flavoured meats and game.", 'abv': '3.5', 'glasswareId': 5, 'availableId': 1, 'styleId': 10, 'isOrganic': 'N', 'status': 'verified', 'statusDisplay': 'Verified', 'createDate': '2012-07-12 13:24:51', 'updateDate': '2012-07-12 13:24:51', 'glass': {'id': 5, 'name': 'Pint', 'createDate': '2012-01-03 02:41:33'}, 'available': {'id': 1, 'name': 'Year Round', 'description': 'Available year round as a staple beer.'}, 'style': {'id': 10, 'categoryId': 1, 'category': {'id': 1, 'name': 'British Origin Ales', 'createDate': '2012-03-21 20:06:45'}, 'name': 'English-Style Pale Mild Ale', 'shortName': 'English Pale Mild', 'description': 'English pale mild ales range from golden to amber in color. Malt flavor dominates the flavor profile with little hop bitterness or flavor. Hop aroma can be light. Very low diacetyl flavors may be appropriate in this low-alcohol beer. Fruity-ester level is very low. Chill haze is allowable at cold temperatures.', 'ibuMin': '10', 'ibuMax': '20', 'abvMin': '3.2', 'abvMax': '4', 'srmMin': '8', 'srmMax': '17', 'ogMin': '1.03', 'fgMin': '1.004', 'fgMax': '1.008', 'createDate': '2012-03-21 20:06:45', 'updateDate': '2015-04-07 15:20:35'}}

{'id': 'MMA4Rp', 'name': 'GFB', 'nameDisplay': 'GFB', 'description': 'GFB our Golden, with the sort of light clean tasty quality which makes an ideal session ale. Tasted to destruction by our brewers, GFB our Golden Best has a hoppy aroma and is packed full of the very best East Kent Goldings, leading to a good dry finish.

GFB our Golden Best has an ABV of 3.5%

Please note: that poly pins are not stock items, but lovingly made to order for you. We need at least 5 working days to produce your order. Thank you for your patience.', 'abv': '3.5', 'styleId': 36, 'isOrganic': 'N', 'labels': {'icon': 'https://s3.amazonaws.com/brewerydbapi/beer/MMA4Rp/upload_sRkZgp-icon.png', 'medium': 'https://s3.amazonaws.com/brewerydbapi/beer/MMA4Rp/upload_sRkZgp-medium.png', 'large': 'https://s3.amazonaws.com/brewerydbapi/beer/MMA4Rp/upload_sRkZgp-large.png'}, 'status': 'verified', 'statusDisplay': 'Verified', 'createDate': '2015-03-04 09:33:57', 'updateDate': '2015-12-17 23:14:31', 'style': {'id': 36, 'categoryId': 3, 'category': {'id': 3, 'name': 'North American Origin Ales', 'createDate': '2012-03-21 20:06:45'}, 'name': 'Golden or Blonde Ale', 'shortName': 'Blonde', 'description': 'Golden or Blonde ales are straw to golden blonde in color. They have a crisp, dry palate, light to medium body, and light malt sweetness. Low to medium hop aroma may be present but does not dominate. Bitterness is low to medium. Fruity esters may be perceived but do not predominate. Diacetyl should not be perceived. Chill haze should be absent.', 'ibuMin': '15', 'ibuMax': '25', 'abvMin': '4', 'abvMax': '5', 'srmMin': '3', 'srmMax': '7', 'ogMin': '1.045', 'fgMin': '1.008', 'fgMax': '1.016', 'createDate': '2012-03-21 20:06:46', 'updateDate': '2015-04-07 15:27:26'}}
